import React, { useEffect } from "react";
import "./App.css";
import { Parallax, ParallaxLayer } from "@react-spring/parallax";
import { Routes, Route } from "react-router-dom";
import Home from "./routes/home/home.component";
import Locations from "./routes/locations/locations.component";

const MainComponent = () => {
  return (
    <div
      style={{
        height: "100vh",
        width: "100vw",
        position: "fixed",
        top: 0,
        left: 0,
        zIndex: 1,
      }}
    >
      <Home />
    </div>
  );
};

const ParallaxComponent = ({ speed, color }) => {
  const divStyle = { backgroundColor: color, height: "100vh" };
  return (
    <ParallaxLayer speed={speed} offset={0.9} style={{ zIndex: 0 }}>
      <div style={divStyle}>
        <h2>Parallax Component</h2>
      </div>
    </ParallaxLayer>
  );
};

const App = () => {
  return (
    <div
      style={{
        position: "fixed",
        top: 0,
        left: 0,
        height: "100%",
        width: "100%",
      }}
    >
      <Parallax pages={3} style={{ zIndex: 1 }}>
        <ParallaxComponent speed={0.5} color="yellow" />
        <ParallaxComponent speed={0.75} color="purple" />
        <ParallaxComponent speed={1} color="green" />
      </Parallax>
      <MainComponent style={{ position: "fixed", zIndex: 0 }} />
    </div>
  );
};

export default App;
